import React, {Component} from 'react';

class Navbar extends Component 
{
    render()
    {
        return(
            <p className="Navbar">
            <img src="http://www.bestmediainfo.com/wp-content/uploads/2014/03/TTN-logo.jpg" alt="To The New" />
            TTN MART
            </p>
        );
    }
}

export default Navbar;
